sys_variable_value.value:
(function parse(inputs, outputs) {
 var responseBody = JSON.parse(inputs.sourceItem);
 var connector = responseBody.name;
responseBody.name = connector.split("/")[5];
outputs.targetObject = responseBody;
})(inputs, outputs);

(function execute(inputs, outputs) { 
    outputs.projectid = inputs.projectid.trim();
    outputs.location = inputs.location.trim();
})(inputs, outputs);

